import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
class News extends React.Component{
  render(){
    return(
      <div>
      <div className='Heading'>
      <div className='newslogo'></div>
      <div className='newsheading'>NEWS24</div>
      </div>
      <hr/>
      <Headlines/>
      </div>

    )
  }
}
class Headlines extends React.Component{
  constructor(){
    super()
    this.state={headlines:[]}
  }
  componentDidMount(){
    fetch("https://newsapi.org/v2/top-headlines?country=us&apiKey=9ed751fd08904a52a2ba4593563fe7d4").then((res)=>res.json()).then((res)=>this.setState({headlines:res.articles}));
  }
  render(){
    return(
      <div>
        {this.state.headlines.length>0 &&
        this.state.headlines.map((news)=><div style={{color:'white',height:'40px'}}>{news.title} </div> )}
      </div>

    )
  }
}
ReactDOM.render(<News/>,document.getElementById('root'))
